    true,nt"url": null,nt"notes": "This dataset provides information about
    the Nixon Administration's White House Tapes.  The White House Tapes contain sound
    recordings of President Richard Nixon's telephone calls and meetings recorded at
    the White House in Washington, D.C. and the Presidential retreat at Camp David,
    Maryland.   These recordings document many of the major events and decisions of
    the Nixon Administration from February 16, 1971 to July 18, 1973.  This dataset
    offers details for all 22,723 conversations, including title, time and date of recording,
    recording device, geographic coordinates, parent audiotape, participants, and a
    brief descriptive statement.",nt"license_title": "Creative Commons CCZero",nt"extras":
